import React from "react";

import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App(){
    return (
        <div>
            <Header/>
            {notes.map(createNote)}
            <Footer/>
        </div>
    );
}


function createNote(notes){
    return (
        <notes
        id = "notes.id"
        key = "notes.id"
        title = "notes.title"
        content = "notes.content"/>
    );
}



export default App;
